import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../../assets/css/profilePage.css';

function ProfilePage() {

    const navigate = useNavigate();

    const handleRedirect = (page) => {
        switch(page){
        case 'workPage':
            navigate('/work');
            break;
        case 'aboutPage':
            navigate('/about');
            break;
        case 'contactPage':
            navigate('/contact');
            break;
        }
      };

    return (
        <div className='profile-page'>
            {/* Header - 4 button
            Country-Tab
            Name-scroll
            BG image with short desc*/}
            <div className = "headerButtonContainer">
                <button className = "headerButton" onClick={()=>handleRedirect("workPage")}>Work</button>
                <button className = "headerButton" onClick={()=>handleRedirect("aboutPage")}>About</button>
                <button className = "headerButton" onClick={()=>handleRedirect("contactPage")}>Contact</button>
            </div>
            <div className = "locatedAt" >located at coimbatore</div>

            <marquee scrollamount="10" direction = "left" className="scroll-name"> - fahima farook - fahima farook - fahima farook - fahima farook</marquee>
        </div>
    );
}

export default ProfilePage;
